import React from 'react'


class Profile extends React.Component{


    render(){
        const profile =
            <div className="container-fluid">
                <div className="row">
                    <h1>
                        This is your Profile
                    </h1>
                </div>
            </div>
        return (profile)
    }
}

export default Profile;
